import React from 'react';

const SlotM = (props) => {

    if ((props.x == props.y) && (props.y == props.z)) {
        return (
            <>

                <div className="slot">
                    <h1>{props.x} {props.y} {props.z}</h1>
                    <h1>This is matching</h1>
                </div>
                <hr></hr>

            </>

        )
    }
    else {
        return (
            <>
                <div className="slot">
                    <h1>{props.x} {props.y} {props.z}</h1>
                    <h1 >This is not matching</h1>
                </div>
                <hr></hr>
            </>

        )

    }

}

export default SlotM;
